import React, { Component } from 'react'

class RenderSkill extends Component {
    render() {
        return (
            <div>
            {console.log(this.props.skills)}
                <h6 className="language-h6">Languages:</h6>
                        { this.props.skills }
                <h6>Frameworks:</h6>
                        { this.props.skills }
                <h6>Databases:</h6>
                        { this.props.skills }
                <h6>Other:</h6>
                        { this.props.skills }
            </div>
        )
    }
}

export default RenderSkill
